import React from "react";
import trumpyDumpy from "./1rn2iy.jpg";

class Restaurant extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      name: props.name,
      location: props.location,
      imageURL: props.imageURL,
      websiteURL: props.websiteURL,
      costLevel: props.costLevel,
      foodCategory: props.foodCategory,
    };
  }

  render() {
    return (
      <div>
        <h1>
          Name: {this.props.name}
          <br />
          Location: {this.props.location}
          <br />
          Image: <img src={trumpyDumpy} alt="asdad"></img>
          <br />
          websiteURL: {this.props.websiteURL}
          <br />
          costLevel: {this.props.costLevel}
          <br />
          foodCategory: {this.props.foodCategory}
          <br />
        </h1>
      </div>
    );
  }
}

export default Restaurant;
